const yometokenId = 2;

window.onload = async()=>{
    if(typeof window.ethereum !== 'undefined'){
        console.log('MetaMask is installed')
    } else {
        alert('Please install MetaMask')
    }
    //メタマスクをプロバイダーにすると接続した時のチェーンに依存をするのでチェーンの切り替えの処理を追加でする必要がある
    const provider = new ethers.providers.Web3Provider(window.ethereum);
    await provider.send("eth_requestAccounts", []);
    const signer = provider.getSigner()
    
    //chainの切り替え
    const chainChangedButton = document.getElementById("changenetwork");
    chainChangedButton.addEventListener("click",async()=>{
        await window.ethereum.request({
            method: 'wallet_switchEthereumChain',
            params: [{ chainId: '0x1' }],
        });
    })
    
    if(window.ethereum.chainId != 0x1) {
        alert('メインネットに切り替えてください。')
    }else{
        chainChangedButton.style.display = "none";
    }

    //自動でリロードさせる
    ethereum.on('chainChanged', (_chainId) => window.location.reload());
    
    //発行したチェーンに接続してないとコントラクトの中身は空になる
    const daisukeContract = new ethers.Contract(contractAddress, abi, signer);
    console.log(daisukeContract);

    //新郎
    const dannauri = await daisukeContract.tokenURI(dannatokenId);
    console.log(daisukeContract.tokenURI);
    console.log(dannauri);
    const dannadata = (await axios.get(dannauri)).data;
    const dannaimage = dannadata.image;
    console.log(dannaimage);

    setDannaBase64();
    
    function setDannaBase64(){
        document.getElementById("dannanftimage").src = dannaimage;
    }

    //新婦
    const yomeuri = await daisukeContract.tokenURI(yometokenId);
    console.log(daisukeContract.tokenURI);
    console.log(yomeuri);
    const yomedata = (await axios.get(yomeuri)).data;
    const yomeimage = yomedata.image;
    console.log(yomeimage);

    setYomeBase64();
    
    function setYomeBase64(){
        document.getElementById("yomenftimage").src = yomeimage;
    }

    //テストNFTで試す
    async function anniversaryFundWithdraw(){
        const withdraw = await daisukeContract.withdraw_weddingFund();
        console.log(withdraw);
    }

    const withdrawButton = document.getElementById("withdraw");
    withdrawButton.addEventListener('click',anniversaryFundWithdraw);


    let date = Date.now();
    const fifthAnniversaryTimeStamp = new Date(2027, 9, 22, 00, 00);
    const sevenAnniversaryTimeStamp = new Date(2029, 9, 22, 00, 00);
    const twentyfiveAnniversaryTimeStamp = new Date(2047, 9, 22, 00, 00);
    const fifityAnniversaryTimeStamp = new Date(2072, 9, 22, 00, 00);

    let daysLeft = document.getElementById("daysleft");
    const fifityAnniversary = document.getElementById("50th");
    const twentyfiveAnniversary = document.getElementById("50th");
    const sevenAnniversary = document.getElementById("50th");
    const fifthAnniversary = document.getElementById("50th");

    //配列作ってfor文でi++にして簡略化させる
    if(date >= fifityAnniversaryTimeStamp.getTime()){
        fifityAnniversary.style.opacity = "1";
        daysLeft.innerHTML = "ずっと一緒にいてくれてありがとう。これからもよろしくね";
    }else if(date >= twentyfiveAnniversaryTimeStamp.getTime()){
        twentyfiveAnniversary.style.opacity = "1";
        daysLeft.innerHTML = `50年記念日まであと<br>${Math.floor((fifityAnniversaryTimeStamp - date) / 86400000)}日`;
    }else if(date >= sevenAnniversaryTimeStamp.getTime()){
        sevenAnniversary.style.opacity = "1";
        daysLeft.innerHTML = `25年記念日まであと<br>${Math.floor((twentyfiveAnniversaryTimeStamp - date) / 86400000)}日`;
    }else if(date >= fifthAnniversaryTimeStamp.getTime()){
        fifthAnniversary.style.opacity = "1";
        daysLeft.innerHTML = `7年記念日まであと<br>${Math.floor((sevenAnniversaryTimeStamp - date) / 86400000)}日`;
    }else{
        daysLeft.innerHTML = `5年記念日まであと<br>${Math.floor((fifthAnniversaryTimeStamp - date) / 86400000)}日`
    }


}


